import React from "react";

import './CreateAnnonce.css';

class CreateAnnonce extends React.Component {
    render(){
        return(
            <div>
                <div className="chooseMainCategoryDiv">
                    <button type="button" className="btn order border-secondary">Hus</button>
                    <button type="button" className="btn order border-secondary">Bil</button>
                    <button type="button" className="btn order border-secondary">Eindom</button>
                    <button type="button" className="btn order border-secondary">MC</button>
                </div>
                <div className="subCategoryDiv">
                <div className="sort-dropdown-menu">
                    <span>34 Treff</span>
                    <select class="form-select" id="sortby-menu" style={{width: "200px"}}>
                        <option defaultValue value="publishedNew">Nyeste først</option>
                        <option value="publishedOld">Eldste først</option>
                        <option value="priceLowHigh">Pris lav-høy</option>
                        <option value="priceHighLow">Pris høy-lav</option>
                    </select>           
                </div>
                </div>
                <button className="btn btn-primary">Choose</button>
            </div>
        )
    }
}

export default CreateAnnonce;
